import React, { Component } from "react";
import "./Header.css";
import { Link } from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";

export class Header extends Component {
  render() {
    return (
      <Container fluid>
        <Row className="rows">
          <Col lg={6}>
            <div className="navvv">
              <ul>
                <Link className="a" to="/">
                  <li className="navv">Home</li>
                </Link>
                <Link className="b" to="/Culture.js">
                  <li className="navv">Culture</li>
                </Link>
                <Link className="c" to="/Sales.js">
                  <li className="navv">Sales / Promotion</li>
                </Link>
                <Link className="d" to="/About.js">
                  <li className="navv">About</li>
                </Link>
              </ul>
            </div>
          </Col>
          <Col lg={6}>
            <div className="logo">
              {" "}
              9JADIASPORA.
              <div className="anime"></div>
            </div>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default Header;
